import React from 'react';
import './App.css';

class App extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      title: "Kimberly Bone",
      headerLinks: [
        { title: "Home", }
      ]
    }
  }

  render() {
    return(
      <div className="App">
        Hello this is my portfolio website!
      </div>

    )
  };
}

export default App;
